import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Table.css';
import Button from '../Button/Button';
import {PlusIcon,PencilIcon,TrashIcon} from '@heroicons/react/outline'; 
import { Link,} from 'react-router-dom';
import { useState } from 'react';

const Table = () => {
  const [editingCell, setEditingCell] = useState(null);
  const [data, setData] = useState([
    { id: 1, title: 'Sample Title 1', createdBy: 'User 1', createdDate: '2024-04-01', updatedDate: '2024-04-15', deadline: '2024-04-15', description: 'Description 1', progress: '50%' },

    { id: 1, title: 'Sample Title 1', createdBy: 'User 1', createdDate: '2024-04-01', updatedDate: '2024-04-15', deadline: '2024-04-15', description: 'Description 1', progress: '50%' },
  ]);

  const handleEditClick = (id) => {
    setEditingCell(id);
  };

  const handleSaveClick = (id) => {
    setEditingCell(null);
  };

  const handleDeleteClick = (id) => {
  };

  const renderCell = (id, value, isEditing) => {
    if (isEditing) {
      return (
        <input
          type="text"
          value={value}
          onChange={(e) => handleInputChange(id, e.target.value)}
        />
      );
    } else {
      return value;
    }
  };

  const handleInputChange = (id, newValue) => {
    setData(data.map(item => {
      if (item.id === id) {
        return { ...item, title: newValue }; // Assuming title is being edited
      }
      return item;
    }));
  };
  return (
    <div className="container-fluid">
      <div className="table-responsive py-5 border-1">
        <div className='border-work'>
          <h1>Todo-List</h1>
          <Link to="/todo">
              <Button icon={PlusIcon} className="icon-button" />
          </Link>
        </div>
        <table className="table table-bordered table-hover text-center">
        <thead>
            <tr className="head-color">
              <th scope="col">Todo-ID</th>
              <th scope="col">Title</th>
              <th scope="col">Created-by</th>
              <th scope="col">created-date</th>
              <th scope="col">updated-date</th>
              <th scope="col">Dead-line</th>
              <th scope="col">Description</th>
              <th scope="col">Progress</th>
              <th scope="col">Edit</th>
              <th scope="col">Delete</th>
            </tr>
          </thead>
          <tbody>
            {data.map(item => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{renderCell(item.id, item.title, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.createdBy, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.createdDate, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.updatedDate, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.deadline, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.description, editingCell === item.id)}</td>
                <td>{renderCell(item.id, item.progress, editingCell === item.id)}</td>
                <td>
                  {editingCell === item.id ? (
                    <Button className='edit-button' name='Save' onClick={() => handleSaveClick(item.id)} icon={PencilIcon} />
                  ) : (
                    <Button className='edit-button' name='Edit' onClick={() => handleEditClick(item.id)} icon={PencilIcon} />
                  )}
                </td>
                <td>
                  <Button className='delete-button' name='Delete' onClick={() => handleDeleteClick(item.id)} icon={TrashIcon} />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Table;
